import React from 'react';
import About from './About';
import Home from './Home';

const Homee = () => {
    return (
        <div>
            <Home></Home>
            <About></About>
      <Projects></Projects>
      <Skills></Skills>
      <Contact></Contact>
      <Footer></Footer> 
        </div>
    );
};

export default Homee;
